import React, { Component } from 'react';
import './App.css';
import Table from './components/Table'

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { }
  }

  render() {

    return (
      <div className="App">
        <header className="App-header">
          <Table/>
        </header>
      </div>
    );
  }
}

export default App;
